    public function findBySiret(string $siret): OrganizationFetchedView
    {
        if (!isset(self::ORGANIZATION_DATA[$siret])) {
            throw new OrganizationNotFoundException('Organization not found with siret: ' . $siret);
        }

        $data = self::ORGANIZATION_DATA[$siret];

        return new OrganizationFetchedView(
            name: $data['name'],
            code: $data['code'],
            codeType: $data['codeType'],
            geometry: $data['geometry'],
        );
    }
